/* eslint complexity: [2, 4]*/
define(['shared/models/BaseModel'],
  function (BaseModel) {

    var SwaApp = BaseModel.extend({
      defaults: function () {
        return {
          displayName: '',
          loginRedirectURL: '',
          anotherLoginURL: '',
          logoImageId: '',
          internalApplication: null,
          hideAppIcon: false,
          hideIniOS: false,
          autofillSetting: 'global.assign.userName.login',
          '__step__': null,
          '__mode__': 'create',
          '__instanceId__': null,
          '__appName__': null
        };
      },

      parse: function (resp) {
        if (resp.appInstanceId) {
          resp['__instanceId__']  = resp.appInstanceId;
          delete resp.appInstanceId;
        }

        if (resp.appName) {
          resp['__appName__']  = resp.appName;
          delete resp.appName;
        }

        return resp;
      },

      idAttribute: '__appName__',

      urlRoot: '/api/internal/orgadmin/apps/swa'
    });

    return SwaApp;
  });
